import React, {useState, useEffect} from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import axios from 'axios'

function Dashboard() {
  const[ordini, setOrdini] = useState([])
  useEffect(() => {
      axios.get('http://127.0.0.1:8000/ordinazioni/',[])
      .then(res => {
          console.log(res)
          setOrdini(res.data)
      },)
      .catch(err =>{
          console.log(err)
      })
  },[])
  return (
     
    <div className='raw'>
        <Stack spacing={1} direction="row" justifyContent="left"
          alignItems="left">
      {
          ordini.map(ordini =><div className=''>
           {ordini.nome_prenot} - {ordini.totale}
          <Button variant="text" size='small'>Accettato</Button>
          <Button variant="contained"  size='samll'>Consegnato</Button>
          <Button variant="outlined"  size='small'>Rigfiutato</Button>
          </div>
         )
      }
      </Stack>
    </div>
  );
}

export default Dashboard;
